                    <input type="text" className="form-control"/>
                </div>

                <div className="form-group">
                    <label>Email</label>
                    <input type="text" className="form-control"/>
                </div>

                <div className="form-group">
                    <label>Favioret</label>
                    <input type="text" className="form-control"/>
                </div>

                <button type="submit" className="btn btn-success">Save</button>
            </form>
        </>
    );
}

export default Form;
